import React, { Component } from 'react';
import BootstrapTable from 'react-bootstrap-table-next';
import axios from 'axios';
import filterFactory, { textFilter } from 'react-bootstrap-table2-filter';
import paginationFactory from 'react-bootstrap-table2-paginator';

export class Bootstraptab1 extends Component {
  state = {
    enquiry: [],
    columns: [
      // Columns definition...
    ],
  };

  componentDidMount() {
    axios.get('http://localhost:8080/api/egetall').then(response => {
      console.log(response.data);
      this.setState({
        enquiry: response.data,
      });
    });
  }

  render() {
    const options = {
      // Pagination options...
    };

    // Check if the enquiry data has been loaded
    if (this.state.enquiry.length === 0) {
      return <div>Loading...</div>; // You can replace this with a loading indicator
    }

    return (
      <div className="container">
        {/* Render your components */}
        <BootstrapTable
          striped
          hover
          keyField='enquiry_id'
          data={this.state.enquiry}
          columns={this.state.columns}
          filter={filterFactory()}
          pagination={paginationFactory(options)}
        />
      </div>
    );
  }
}

export default Bootstraptab1;
